import React from 'react';
import TableRow from '@material-ui/core/TableRow';
import TableCell from '@material-ui/core/TableCell';


class Asset extends React.Component{
    render(){
        return (
            <TableRow>
                <TableCell>{this.props.nations.id}</TableCell>
                <TableCell>{this.props.assetclass.id}</TableCell>
                <TableCell>{this.props.period.id}</TableCell>
                <TableCell>{this.props.CAGR.id}</TableCell>
            </TableRow>
        )
    }
}

export default Asset;
